const ProductDetails = ({ product }) => {
    return(
        <div className="product-details">
            <h4>{product.title}</h4>
            <p><strong>Load (kg): </strong>{product.load} </p>
            <p><strong>Reps: </strong>{product.reps} </p>
            <p>product.createdAt</p>
        </div>
    )
} 


export default ProductDetails
